import React from 'react';
import {ResponsiveContainer, BarChart, Area, XAxis, YAxis} from "recharts";

const data =[
  {
    name: 'Java',
    student: 12,
    fees: 10
  },
  {
    name: 'JavaScript',
    student: 20,
    fees: 100
  },
  {
    name: 'HTML',
    student: 21,
    fees: 10
  },
  {
    name: 'CSS',
    student: 11,
    fees: 21
  },
]


const MainAreaCharts = () => {
  return <div>
      <ResponsiveContainer width="100%" aspect={4}>
      <AreaChart width={300} height={250} data={data}>
      <XAxis dataKey="name" interval={'preserveStartEnd'}/>
      <YAxis/>
       <Area dataKey="student" stroke="#8884d8" fillOpacity={1}/>
      </AreaChart>

      </ResponsiveContainer>
  </div>;
};

export default MainAreaCharts;
